import React from 'react';

function Button({ label, icon, altText, bgColor = "primary-primary500", textColor = "base-black", borderColor = "primary-primary500", hoverBgColor = "primary-primary700", hoverTextColor = "base-white", hoverBorderColor = "primary-primary700" }) {
  return (
    <button
      className={`flex gap-2 justify-center px-3 py-2 ${bgColor} ${textColor} ${borderColor} border rounded-xl hover:${hoverBgColor} hover:${hoverTextColor} hover:${hoverBorderColor}`}
      aria-label={altText}
    >
      <div className="shrink-0 my-auto w-4 aspect-square">
        {icon}
      </div>
      <span className="font-bold">{label}</span>
    </button>
  );
}

export default Button;
